`,paraId:16,tocIndex:9},{value:"\u65B0\u5EFA\u4E00\u4E2A fiber \u5C01\u88C5\u7C7B",paraId:17,tocIndex:10},{value:`// ReactFiber
export function createFiber(vnode, returnFiber) {
  const fiber = {
    type: vnode.type, // \u8868\u793Afiber\u7684\u771F\u5B9E\u7C7B\u578B \u8FD9\u4E2A\u548CelementType\u5927\u90E8\u5206\u60C5\u51B5\u4E0B\u662F\u4E00\u6837\u7684 \u5728\u4F7F\u7528\u4E86\u61D2\u52A0\u8F7D\u4E4B\u7C7B\u7684\u529F\u80FD\u65F6\u53EF\u80FD\u4F1A\u4E0D\u4E00\u6837\u3002 \u533A\u522B\u4E8E tag\uFF0Ctype\u53EF\u4EE5\u81EA\u5B9A\u4E49\uFF0C\u5F53\u662F\u7EC4\u4EF6\u65F6 type\u53EF\u4EE5\u662F\u8FD9\u4E2A\u7EC4\u4EF6\u7684\u6784\u9020\u51FD\u6570\uFF0C\u7528\u6237\u521B\u5EFA\u5143\u7D20\u65F6\u4F7F\u7528
    key: vnode.key,
    props: vnode.props, // \u5C5E\u6027
    // \u7B2C\u4E00\u4E2A\u5B50\u8282\u70B9fiber
    child: null,
    // \u4E0B\u4E00\u4E2A\u5144\u5F1Ffiber
    sibling: null,
    // \u7236fiber
    return: returnFiber,
    // dom\u6216\u5B9E\u4F8B
    // \u51FD\u6570\u5F0F\u7EC4\u4EF6\u4E3Anull\uFF0C\u4ED6\u7684\u5B9E\u4F8B\u5B58\u5728child\u91CC\uFF0C\u8FD9\u4E5F\u662F\u4E3A\u4EC0\u4E48render\u91CC\u53EA\u80FD\u6709\u4E00\u4E2A\u8DDF\u8282\u70B9
    stateNode: null,
    // \u8282\u70B9\u4E0B\u6807
    index: null,
    // old fiber
    alternate: null,
    flags: Placement,
    tag: null,
  };

  const { type } = vnode;

  // \u6253 tag
  if (isStr(type)) {
    // \u539F\u751F\u6807\u7B7E
    fiber.tag = HostComponent; // \u4F20\u5165\u7684\u662Fdom.nodeName
  } else if (isFn(type)) {
    // \u51FD\u6570\u7EC4\u4EF6 \u7C7B\u7EC4\u4EF6
    fiber.tag = type.prototype.isReactComponent
      ? ClassComponent
      : FunctionComponent;
  } else if (isUndefined(type)) {
    // \u6B64\u65F6\u662F\u7EAF\u6587\u672C\u6216\u6570\u5B57\u8282\u70B9
    fiber.tag = HostText;
    fiber.props = { children: vnode };
  } else {
    fiber.tag = Fragment;
  }

  return fiber;
}
